    componentDidMount(){
     this.props.getBourbons()
    }

    handleClick = (event) => {
        console.log(event.target.id)
    }



    render() {
        const bourbons = this.props.bourbons.map((bourbon, i) =>
         <Bourbon key={i} bourbon={bourbon} />
        )

        return (
            <div>
                {bourbons}
            </div>
        )
    }
}

